package com.entity;

public class Specalist {
private int id;
private String name;

public Specalist() {
	super();
	// TODO Auto-generated constructor stub
}
public Specalist(int id, String name) {
	super();
	this.id = id;
	this.name = name;
}
public int getId() {
	return id;
}
public void setId(int id) {
	this.id = id;
}
public String getName() {
	return name;
}
public void setName(String name) {
	this.name = name;
}



}
